userDefinedLinkHintCss:
/* everforest palette */

:root {
  --red: #e67e80;
  --orange: #e69875;
  --yellow: #dbbc7f;
  --green: #a7c080;
  --blue: #7fbbb3;
  --aqua: #83c092;
  --purple: #d699b6;
  --fg: #d3c6aa;
  --bg_dim: #232a2e;
  --bg0: #2d353b;
  --bg1: #343f44;
  --bg2: #3d484d;
  --bg3: #475258;
  --bg4: #4f585e;
  --bg5: #56635f;
  --bg_red: #543a48;
  --bg_orange: #514045;
  --bg_yellow: #4d4c43;
  --bg_green: #425047;
  --bg_blue: #3a515d;
  --gray0: #7a8478;
  --gray1: #859289;
  --gray2: #9da9a0;


}
#vimiumHintMarkerContainer div.internalVimiumHintMarker, #vimiumHintMarkerContainer div.vimiumHintMarker {
  padding: 3px 4px;
  background: var(--green);
  border: 1;
  border-color: var(--bg0);
  box-shadow: none;
}

#vimiumHintMarkerContainer div span {
  color: var(--bg0);
  text-shadow: none;
}

#vimiumHintMarkerContainer div > .matchingCharacter {
  opacity: 1.0;
  color: var(--bg5);
}

#vimiumHintMarkerContainer div > .matchingCharacter ~ span {
  color: var(--bg0);
}

#vomnibar {
  background: var(--bg0);
  border: 2px solid var(--green);
  animation: show 200ms cubic-bezier(0, 0, 0.2, 1) forwards;
  max-height: calc(100vh - 70px);
  overflow: hidden;
}

@keyframes show {
  0% {
    transform: translateY(50px);
    opacity: 0;
  }
  100% {
    transform: translateY(0);
    opacity: 1;
  }
}

#vomnibar input {
  color: var(--fg);
  background: var(--bg0);
  border: none;
  height: unset;
  padding: 16px 30px;
}

#vomnibar .vomnibarSearchArea {
  border: none;
  padding: unset;
  background: var(--bg0)
}

#vomnibar ul {
  padding: 0;
  margin: 0;
  background: var(--bg0);
  border-top: 1px solid var(--bg_dim);
}

#vomnibar li {
  padding: 10px;
  border-bottom: 1px solid var(--bg_dim)
}

#vomnibar li .vomnibarTopHalf,
#vomnibar li .vomnibarBottomHalf {
  padding: 3px 0;
}

#vomnibar li .vomnibarSource {
  color: var(--fg);
}

#vomnibar li em,
#vomnibar li .vomnibarTitle {
  color: var(--green);
  font-weight: bold;
}

#vomnibar li .vomnibarUrl {
  color: var(--fg);
}

#vomnibar li .vomnibarMatch {
  color: var(--green);
  font-weight: bold;
}

#vomnibar li .vomnibarTitle .vomnibarMatch {
  color: var(--blue);
}

#vomnibar li.vomnibarSelected {
  background-color: var(--bg1);
}

div.vimiumHUD {
  background: var(--bg0);
  border: 2px solid var(--green);
  box-shadow: none;
}

div.vimiumHUD span#hud-find-input,
div.vimiumHUD .vimiumHUDSearchAreaInner {
  color: var(--fg)
}

div.vimiumHUD .hud-find {
  background-color: var(--bg0);
  border: none;
}

div.vimiumHUD .vimiumHUDSearchArea {
  background-color: var(--bg0);
}
